	add("apahack", "{\"term\":\"apahack\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|APA|hack|gloss1\u003damateur press association|gloss2\u003dpejorative; untalented writer|la...\u0026quot;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fan who is a writer and creator of apazines for one or more amateur press associations; especially a prolific one\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Yup, that\u0027s why I have a basement full of Gestetners (a 260, a 360, a 420, and a 1525), a couple of ancient Rex-Rotary M4s and two e-stencillers. And a hectograph. I have been a fanzine editor and \u0027\u0027apahack\u0027\u0027, but it\u0027s been a while since last I pubbed my ish\", \"priority\":2}]}, \"synonyms\":{}}");

