	add("apanage", "{\"term\":\"apanage\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027apanage\u0027 from Latin *\u0027\u0027 () \u0027adpanare\u0027 () from {{m|la|pānis||bread}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A grant (especially by a sovereign) of land (or other source of revenue) as a birthright\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1942\u0027\u0027: they suspected that Peter II was only waiting till he had saved enough of his \u0027\u0027apanage\u0027\u0027 to run away to some more civilized country. — Rebecca West, \u0027Black Lamb and Grey Falcon\u0027 (Canongate 2006, p. 1046\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A perquisite that is appropriate to one\u0027s position\", \"priority\":3}]}, \"synonyms\":{}}");

	add("apanthropinisation", "{\"term\":\"apanthropinisation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Coined by w:Grant Allen|C. Grant B. Allen in 1880 in volume 5 of the quarterly-review journal \u0027w:Mind (journal)|Mind\u0027 : \u0027ap-\u0027 (from Ancient greek (to 1453) \u0027sc\u003dpolytonic|ἀπ-\u0027 (off, away) + \u0027anthropinism\u0027 + \u0027-isation\u0027 noun suffix denoting the action of the suffixed verb.\u0026lt;ref name\u003d\u0026quot;OED\u0026quot;\u0026gt;“[http://dictionary.oed.com/cgi/entry/50010053?query_type\u003dword\u0026amp;queryword\u003dapanthropinization\u0026amp;first\u003d1\u0026amp;max_to_show\u003d10\u0026amp;single\u003d1\u0026amp;sort_type\u003dalpha apanthropinization]” listed in the \u0027Oxford English Dictionary\u0027, second edition (1989)\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"lt;ref name\u003d\u0026quot;OED\u0026quot;/\u0026gt; The broadening of the ambit of one’s preoccupations and concerns away from a narrow focus on those things most palpably human and most closely pertinent to humanity.\u0026lt;ref name\u003d\u0026quot;OED\u0026quot;/\u0026gt;\u0026lt;ref name\u003d\u0026quot;DEE\u0026quot;\u0026gt;“apanthropinization” listed [http://books.google.co.uk/books?id\u003dQHccAAAAMAAJ\u0026amp;q\u003dapanthropinization\u0026amp;dq\u003dapanthropinization\u0026amp;ei\u003dHdVWScTmHqKIyASJ8aiDBw\u0026amp;pgis\u003d1 on pages 50–51] of Joseph Twadell Shipley’s \u0027Dictionary of Early English\u0027 (\u0027\u00271955\u0027\u0027; Philosophical Library)\u0026lt;/ref\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"lt;b\u0026gt;1880, \u0026lt;span style\u003d\u0026quot;font-variant:small-caps\u0026quot;\u0026gt;Oct.\u0026lt;/span\u0026gt;\u0026lt;/b\u0026gt;: w:Grant Charles Grant Blairfindie Allen [contrib.] and w:George Croom George Croom Robertson (editor) of the w:Mind Mind Association, \u0027Mind\u0027, volume 5 (№ 20), [http://books.google.co.uk/books?id\u003dsEsFAAAAQAAJ\u0026amp;q\u003dapanthropinisation\u0026amp;dq\u003dapanthropinisation\u0026amp;ei\u003d_c1WSdnaDKTmyAT-67mlCQ\u0026amp;pgis\u003d1 page 451] \u0026lt;sup\u0026gt;[http://books.google.co.uk/books?id\u003dF_0EAAAAQAAJ\u0026amp;q\u003dapanthropinisation\u0026amp;dq\u003dapanthropinisation\u0026amp;ei\u003d_c1WSdnaDKTmyAT-67mlCQ\u0026amp;pgis\u003d1 〃]\u0026lt;/sup\u0026gt; (Williams and Norgate) \u0027\u0027·\u0027\u0027 (also quoted, with scant little alteration, [http://books.google.co.uk/books?id\u003d3pINAAAAQAAJ\u0026amp;q\u003dapanthropinisation\u0026amp;dq\u003dapanthropinisation\u0026amp;ei\u003d_c1WSdnaDKTmyAT-67mlCQ\u0026amp;pgis\u003d1 on page 292] of \u0027The Academy\u0027 [№ 18, 1880\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In short, the primitive human conception of beauty must, I believe, have been purely \u0027anthropinistic\u0027 — must have gathered mainly around the personality of man or woman; and all its subsequent history must be that of an \u0027\u0027\u0027apanthropinisation\u0027\u0027\u0027 (I apologise for the ugly but convenient word), a gradual regression or concentric widening of æsthetic feeling around this fixed point which remains to the very last its natural centre\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"lt;b\u0026gt;1881, \u0026lt;span style\u003d\u0026quot;font-variant:small-caps\u0026quot;\u0026gt;Jan.\u0026lt;/span\u0026gt;\u0026lt;/b\u0026gt;: \u0027w:Popular The Popular Science Monthly\u0027, volume 18 (1880–1881), [http://books.google.co.uk/books?id\u003dEiIDAAAAMBAJ\u0026amp;pg\u003dPA344\u0026amp;dq\u003dapanthropinization\u0026amp;ei\u003dHdVWScTmHqKIyASJ8aiDBw page 344] \u0026lt;sup\u0026gt;[http://books.google.co.uk/books?id\u003daaMVAAAAYAAJ\u0026amp;dq\u003dapanthropinization\u0026amp;ei\u003dHdVWScTmHqKIyASJ8aiDBw 〃]\u0026lt;/sup\u0026gt; (D. Appleton); quoting \u0027verbatim\u0027, but not \u0027literatim\u0027, the text of the first occurrence in \u0027Mind\u0027 [1880\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"hereinbefore (minor adjustments to Americanise the spelling have been made\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"In short, the primitive human conception of beauty must, I believe, have been purely \u0027anthropinistic\u0027 — must have gathered mainly around the personality of man or woman; and all its subsequent history must be that of an \u0027\u0027\u0027apanthropinization\u0027\u0027\u0027 (I apologize for the ugly but convenient word), a gradual regression or concentric widening of æsthetic feeling around this fixed point which remains to the very last its natural center\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"lt;b\u0026gt;2005, \u0026lt;span style\u003d\u0026quot;font-variant:small-caps\u0026quot;\u0026gt;Mar.\u0026lt;/span\u0026gt;\u0026lt;/b\u0026gt;: Anne-Julia Zwierlein (editor), \u0027Unmapped Countries: Biological Visions in Nineteenth-Century Literature and Culture\u0027, [http://books.google.co.uk/books?id\u003dDp_qjgwqx0EC\u0026amp;pg\u003dPA114\u0026amp;dq\u003dapanthropinization\u0026amp;ei\u003dHdVWScTmHqKIyASJ8aiDBw page 114] ([http://www.anthempress.com/product_info.php?\u0026amp;products_id\u003d143\u0026amp;osCsid\u003d Anthem Press]; ISBN 1843311607, 978‒1843311607\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"From this early, ‘anthropinistic’ stage, at which all aesthetic feeling is ‘gathered mainly around the personality of man or woman’, human aesthetic feeling gradually evolves in a process of \u0027\u0027apanthropinization\u0027\u0027, ‘a gradual regression or concentric widening of aesthetic feeling around this fixed point’,\u0026lt;sup\u0026gt;59\u0026lt;/sup\u0026gt; and advances to the appreciation of beauty in nature.\u0026lt;sup\u0026gt;60\u0026lt;/sup\u0026gt\", \"priority\":8}]}, \"synonyms\":{}}");

