	add("apartheid", "{\"term\":\"apartheid\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"Afrikaans\", \"English\", \"Dutch\"], \"text\":\"From Afrikaans \u0027apartheid\u0027 (1929 in a South African socio-political context), literally “separateness”, “apartness”, from Dutch \u0027apart\u0027 (separate) + suffix \u0027-heid\u0027 cognate of English \u0027-hood\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The discriminatory policy of racial separation used by South Africa from 1948 to 1990\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Nelson Mandela, \u0027Long Walk to Freedom\u0027, Abacus 2010, pages 127-8\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The premise of \u0027\u0027apartheid\u0027\u0027 was that whites were superior to Africans, Coloureds and Indians, and the function of it was to entrench white supremacy forever\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any similar policy of racial separation/segregation and discrimination\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1963\u0027\u0027, Justice William O. Douglas, concurring, \u0027Lombard v. Louisiana\u0027 (373 U.S. 267\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"When the doors of a business are open to the public, they must be open to all regardless of race if \u0027\u0027apartheid\u0027\u0027 is not to become engrained in our public\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A policy or situation of segregation based on some specified attribute\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Peter Hewitt, \u0027Kenya Cowboy: A Police Officer\u0027s Account of the Mau Mau Emergency\u0027 (ISBN 1920143238), page 64\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Fifteen minutes drive to the Brown Trout was guaranteed to satisfy my appetite because there, as with other clubs and hotel bars, a form of sex \u0027\u0027apartheid\u0027\u0027 was practised. The males assembled in the region of the bar and the opposite gender either sat discreetly detached or strayed outside to gossip gaily among themselves\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Moorthy Muthuswamy, \u0027Defeating Political Islam: The New Cold War\u0027 (ISBN 1615921389), page 120\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"In these annual reports, the religious \u0027\u0027apartheid\u0027\u0027 practices in India are not mentioned at all\", \"priority\":11}]}, \"synonyms\":{}}");

	add("apartment", "{\"term\":\"apartment\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"French \u0027appartement\u0027 compare with Italian \u0027appartamento\u0027 from \u0027appartare\u0027 (to separate, set apart) all from Latin \u0027ad\u0027 + \u0027pars\u0027 \u0027part\u0027. See \u0027apart\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A complete domicile occupying only part of a building\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"apartment dwellers\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A suite of rooms within a domicile, designated for a specific person or persons and including a bedroom\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"By this contrivance I got into the inmost court; and, lying down upon my side, I applied my face to the windows of the middle stories, which were left open on purpose, and discovered the most splendid \u0027\u0027apartments\u0027\u0027 that can be imagined. There I saw the empress and the young princes in their several lodgings, with their chief attendants about them\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A division of an enclosure that is separate from others; a compartmen\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1883\u0027\u0027 April 23, \u0027Slawson \u0027v.\u0027 Grand Street R. Co.\u0027, 107 U.S. 649, 2 S.Ct. 663, 664\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The specification described the ordinary fare-box used in street cars and omnibuses, consisting of two \u0027\u0027apartments\u0027\u0027, the one directly above the other.... [T]he passenger deposited his fare in an aperture in the top of the upper \u0027\u0027apartment\u0027\u0027. It fell upon and was arrested by a movable platform.... This platform turned on an axis acted on by a lever. When turned, the fare fell into the lower \u0027\u0027apartment\u0027\u0027, which was a receptacle for holding the fares accumulated\", \"priority\":7}]}, \"synonyms\":{}}");

	add("apatheia", "{\"term\":\"apatheia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"Ancient greek (to 1453) \u0027ἀπάθεια\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A state of mind in Stoic philosophy in which one is free from emotional disturbance; the freedom from all passions\", \"priority\":1}]}, \"synonyms\":{}}");

	add("apatheism", "{\"term\":\"apatheism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Reportedly coined in 2001, as a {{blend|apathy|theism|nocap\u003d1|lang\u003den}}, by author Robert J. Nash.\u0026lt;ref\u0026gt;Robert J. Nash, \u0027Religious Pluralism in the Academy: Opening the Dialogue\u0027 (2001), ISBN 9780820455921, [http://books.google.ca/books?ei\u003d-hOgTPmXOceinQeV98ipDQ\u0026amp;ct\u003dresult\u0026amp;id\u003dal7XAAAAMAAJ\u0026amp;dq\u003dapatheism\u0026amp;q\u003dapatheis. search_anchor p. 27].\u0026lt;/ref\u0026gt;\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Apathy towards the existence of a god; belief that the question of the existence of a god is unimportant\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2003\u0027\u0027, w:Jonathan Jonathan Rauch \u0026quot;[http://www.theatlantic.com/magazine/archive/2003/05/let-it-be/2726/ Let It Be],\u0026quot; \u0027The Atlantic\u0027 (US), May (retrieved 26 Sep 2010\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A]patheism\u0027\u0027 is an attitude, not a belief system, and the over-riding fact is that these people are relaxed about religion\", \"priority\":3}]}, \"synonyms\":{}}");

	add("apatheist", "{\"term\":\"apatheist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{blend|apathy|atheist|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who may accept the existence of a god, but who does not care about that god\u0027s existence\", \"priority\":1}]}, \"synonyms\":{}}");

	add("apathete", "{\"term\":\"apathete\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027apathy\u0027 \u0027apathetic\u0027 on the pattern of \u0027aesthete\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An apathetic person; one given to apathy\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1976\u0027\u0027: Christopher G. A. Bryant, \u0027Sociology in Action: A Critique of Selected Conceptions of the Social Role of the Sociologist\u0027, [http://books.google.co.uk/books?id\u003d2_sEAAAAMAAJ\u0026amp;q\u003dapathete\u0026amp;dq\u003dapathete\u0026amp;ei\u003dQ2m1SMHWFafKzAT1kOH_Bg\u0026amp;pgis\u003d1 page 145] (Allen and Unwin; ISBN 0043000584, 9780043000588\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"He does not condemn the \u0027\u0027apathete\u0027\u0027, indeed he recognises that the alienating character of most industrial and commercial work affects leisure too\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027: Will Self \u0026amp; Ralph Steadman, \u0027Psychogeography\u0027, [http://books.google.co.uk/books?id\u003dWJplAAAAMAAJ\u0026amp;q\u003dapathete\u0026amp;dq\u003dapathete\u0026amp;ei\u003dQ2m1SMHWFafKzAT1kOH_Bg\u0026amp;pgis\u003d1 page 42] (Bloomsbury Publishing Plc.; ISBN 0747590338, 9780747590330\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I remember that afternoon in SoHo because it was on my first, conscious trip to New York; and even an experienced \u0027\u0027apathete\u0027\u0027 such as myself – the shirker of the Taj Mahal, the dodger of the\u0026lt;!-- [sic] --\u0026gt; Alhambra – was still struck by how inappropriate this seemed\", \"priority\":5}]}, \"synonyms\":{}}");

	add("apatheticness", "{\"term\":\"apatheticness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|apathetic|ness|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Apathy, quality of being apathetic\", \"priority\":1}]}, \"synonyms\":{}}");

	add("apathy", "{\"term\":\"apathy\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From French \u0027apathie\u0027 from Latin {{m|la|apathīa}}, from Ancient greek (to 1453) \u0027sc\u003dpolytonic|ἀπάθεια\u0027 (impassibility”, “insensibility”, “freedom from emotion) from \u0027sc\u003dpolytonic|ἀπαθής\u0027 (not suffering or having suffered”, “without experience of) from \u0027sc\u003dpolytonic|ἀ-\u0027 (not) + \u0027sc\u003dpolytonic|πάθος\u0027 (anything that befalls one”, “incident”, “emotion”, “passion)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Complete lack of emotion or motivation about a person, activity, or object; depression; lack of interest or enthusiasm; disinterest\", \"priority\":1}]}, \"synonyms\":{}}");

	add("apatosaur", "{\"term\":\"apatosaur\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A large, herbivorous, gregarious sauropod dinosaur, of the genus \u0027Apatosaurus\u0027, from Jurassic North America; it had a long neck and tail\", \"priority\":1}]}, \"synonyms\":{}}");

	add("apazine", "{\"term\":\"apazine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|APA|zine|gloss1\u003damateur press association|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A periodical created by a member of an amateur press association for distribution to all of its members\", \"priority\":1}]}, \"synonyms\":{}}");

